INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 0.0, "2019/07/31 12:00:00", 4, 24015, 110501, 1, 24, 10021, 4);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 4.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 0.0, "2019/07/31 12:00:00", 1, 24016, 110501, 2, 24, 10021, 4);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 0.0, "2019/07/31 12:00:00", 4, 24017, 110501, 3, 24, 10021, 4);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 5.2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 0.0, "2019/07/31 12:00:00", 2, 24018, 110501, 4, 24, 10021, 1);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 4.2, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 0.0, "2019/07/31 12:00:00", 6, 24019, 110501, 5, 24, 10021, 5);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 0.0, "2019/07/31 12:00:00", 2, 24020, 110501, 6, 24, 10021, 2);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 6.4, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 0.0, "2019/07/31 12:00:00", 6, 24021, 110501, 7, 24, 10021, 1);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 0.0, "2019/07/31 12:00:00", 2, 24022, 110501, 8, 24, 10021, 2);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 10.08, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 0.0, "2019/07/31 12:00:00", 3, 24023, 110501, 9, 24, 10021, 6);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 5.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 0.0, "2019/07/31 12:00:00", 2, 24024, 110501, 10, 24, 10021, 1);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 0.0, "2019/07/31 12:00:00", 2, 24025, 110501, 11, 24, 10021, 2);
